INSERT INTO `term_condtion` (`term_condtion_id`, `condition_name`, `condition_desc`, `created_at`) VALUES
(1, 'Goods Quality', 'Specifies the stringent quality standards and requirements for the received goods. It outlines the acceptable conditions, criteria, and parameters that the delivered goods must meet to ensure their overall quality. This includes aspects such as material d', '2024-01-19 06:15:05'),
(2, 'Payment Terms', 'Defines the payment terms and conditions governing financial transactions related to purchase orders. This includes specifying the payment methods, due dates, and any applicable late payment fees or discounts for early payments. The payment terms aim to e', '2024-01-19 06:15:05'),
(3, 'Delivery Schedule', 'Outlines the agreed-upon schedule for the delivery of goods. This includes details about shipment dates, delivery locations, and any specific delivery instructions. The delivery schedule ensures that the ordered goods reach the buyer within the stipulated', '2024-01-19 06:15:05'),
(4, 'Warranty Information', 'Details the warranty period and conditions for products. This includes information about the duration of the warranty, coverage, and any terms or actions required to claim warranty services. The warranty information provides assurance to the buyer regardi', '2024-01-19 06:15:05'),
(5, 'Return Policy', 'Specifies the terms and conditions for returning goods in case of defects, damages, or other specified reasons. It outlines the steps and requirements for initiating a return, including any associated costs or restocking fees. The return policy aims to pr', '2024-01-19 06:15:05'),
(6, 'Penalties for Delays', 'Outlines penalties or consequences for delays in the delivery of goods. This includes details about any financial penalties, compensations, or actions that may be taken in the event of delayed deliveries. The penalties for delays serve as a mechanism to e', '2024-01-19 06:15:05'),
(7, 'Confidentiality Agreement', 'Establishes terms related to the confidentiality of information exchanged during the course of the purchase order. This includes provisions to protect sensitive and proprietary information, restricting its use or disclosure to unauthorized parties. The co', '2024-01-19 06:15:05'),
(8, 'Dispute Resolution', 'Describes the process for resolving disputes related to the purchase order. This includes the escalation procedures, mediation, arbitration, or other methods to address and resolve conflicts between the buyer and seller. The dispute resolution terms provi', '2024-01-19 06:15:05');
